// SPDX-License-Identifier: MIT

pragma solidity ^0.6.0;

import "@openzeppelin/contracts/utils/Pausable.sol";

import "./ERC777Snapshot.sol";
import "./FCRoles.sol";
import "./SponsorWhitelistControl.sol";

import "./utils/LimitedSetup.sol";

contract FC is ERC777Snapshot, FCRoles, Pausable, LimitedSetup
{
    using SafeMath for uint256;

    uint256 constant public CAP = 21000000 ether;

    SponsorWhitelistControl constant public SPONSOR = SponsorWhitelistControl(address(0x0888000000000000000000000000000000000001));

    constructor()
        ERC777("FansCoin", "FC", new address[](0))
        ERC777Snapshot()
        LimitedSetup(1 weeks)
        public
    {
        // register all users as sponsees
        address[] memory users = new address[](1);
        users[0] = address(0);
        SPONSOR.addPrivilege(users);

        _pause();
    }

    function cap() public pure returns (uint256) {
        return CAP;
    }

    //---------------- Data Migration ----------------------
    function batchSetStateOf(address[] memory accounts, uint256[] memory ConfluxPools, uint256[] memory Personals, uint256[] memory Lockeds) public onlyPauser onlyDuringSetup {
        for (uint256 i = 0; i < accounts.length; i++) {
            setStateOf(accounts[i], ConfluxPools[i], Personals[i], Lockeds[i]);
        }
    }

    function setStateOf(address account, uint256 ConfluxPool, uint256 Personal, uint256 Locked) public onlyPauser onlyDuringSetup {
        require(account != address(0), "FC: Migration to the zero address");
        _balances[account] = ConfluxPool.add(Personal).add(Locked);
        emit Write(account, ConfluxPool, Personal, Locked);
    }

    function setTotalSupply(uint256 total) public onlyPauser onlyDuringSetup {
        _totalSupply = total;
    }
    //---------------- End Data Migration ----------------------

    function mint(address account, uint256 value) public onlyMinter returns (bool) {
        require(totalSupply().add(value) <= CAP, "ERC20Capped: cap exceeded");
        _mint(account, value, "", "");
    }

    function pause() public onlyPauser {
        _pause();
    }

    function unpause() public onlyPauser {
        _unpause();
    }

    function snapshot() public onlyRecorder returns (uint256) {
        return _snapshot();
    }

    function _beforeTokenTransfer(address operator, address from, address to, uint256 amount) internal override {
        require(!paused(), "ERC20Pausable: token transfer while paused");
        super._beforeTokenTransfer(operator, from, to, amount);
    }

    event Write(address indexed account, uint256 CPool, uint256 PPool, uint256 PPoolLocked);
}
